<head>
  <meta charset="UTF-8">
  <title>My Projects</title>
  <link rel="stylesheet" href="Mystyless.css">
  <style>
    .project-gallery {
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      gap: 30px;
      padding: 20px;
    }

    .project-card {
      width: 250px;
      background: rgba(255, 255, 255, 0.9);
      border-radius: 12px;
      box-shadow: 0 6px 18px rgba(0, 0, 0, 0.1);
      overflow: hidden;
      text-align: center;
      transition: transform 0.3s ease;
    }

    .project-card:hover {
      transform: scale(1.05);
    }

    .project-card img {
      width: 100%;
      height: 160px;
      object-fit: cover;
    }

    .project-card a {
      display: block;
      padding: 15px;
      text-decoration: none;
      font-weight: bold;
      color: #a26769;
      transition: color 0.3s;
    }

    .project-card a:hover {
      color: #333;
    }
  </style>
